import React, { Component } from 'react';

export default class Cases extends Component {
    render() {
        return (
            <div className="container">
                <main id="case-count">
                    <h1>Cases</h1>
                    <h2>More Cases</h2>
                    <h3>More more Cases</h3>
                </main>
            </div>
        );
    }
}

class WorldStats extends Component {
    constructor(props) {
        super(props);
        this.state = {
            confirmed: '',
            recovered: '',
            deaths: ''
        };
    }

    componentDidMount() {
        fetch('https://wuhan-coronavirus-api.laeyoung.endpoint.ainize.ai/jhu-edu/brief')
            .then((response) => response.json )
            .then ((data) => {
                this.setState({ confirmed: data.confirmed, recovered: data.recovered, deaths: data.deaths })
            })
    }
}
